import React, { useEffect } from "react";
import M from 'materialize-css/dist/js/materialize.min.js';


function Navbar() {

  useEffect(() => {
  }, []);

  document.addEventListener('DOMContentLoaded', function() {
    let elems = document.querySelectorAll('.sidenav');
    M.Sidenav.init(elems);
  });

  return (
    <div>

      <nav className="nav-extended">
        <div className="nav-wrapper">

          <ul id="nav-mobile" className="left hide-on-med-and-down">




            <li><a href="sass.html">Sass</a></li>
            <li><a href="badges.html">Components</a></li>
            <li><a href="collapsible.html">JavaScript</a></li>
          <div class="right input-field col s6 s12 red-text">
            <i class="red-text material-icons prefix">search</i>
            <input type="text" placeholder="search" id="autocomplete-input" class="autocomplete red-text" />
            <i className="material-icons">close</i>
          </div>
          </ul>


          <a href="/" className="center brand-logo">Logo</a>
          <a href="/" data-target="mobile-demo" className="sidenav-trigger"><i className="material-icons">menu</i></a>


        </div>
      </nav>
          <div className="right input-field">
            <input id="search" type="search" required />
            <label className="label-icon" htmlFor="search"><i className="material-icons">search</i></label>
            <i className="material-icons">close</i>
          </div>

      <ul className="sidenav" id="mobile-demo">
        <li><a href="sass.html">Sass</a></li>
        <li><a href="badges.html">Components</a></li>
        <li><a href="collapsible.html">JavaScript</a></li>
      </ul>

    </div>
  );

}

export default Navbar;
